import React, { useState, useEffect } from 'react';
import Chart from 'react-google-charts';

const SiemPieChart = () => {
  const [pieChartData, setPieChartData] = useState([]);


  return (
    <div>
      <h2>Pie Chart</h2>
      <Chart
        width={'100%'}
        height={'400px'}
        chartType="PieChart"
        data={pieChartData}
        options={{
          title: 'Pie Chart',
          is3D: true,
        }}
        rootProps={{ 'data-testid': '1' }}
      />
    </div>
  );
};

export default SiemPieChart;
